export const FRAGMENT_ITEM_PROPERTIES = `fragment ItemProperties on Item {
  id
  name
  description
  thumbnailUrl
  rarityIndex
  isNc
  isPb
}`;

export const FRAGMENT_ITEM_APPEARANCE = `
fragment ItemAppearanceForOutfitPreview on ItemAppearance {
    id
    restrictedZones {
      id
      depth
      label
    }
    layers {
      id
      remoteId
      imageUrlV2(idealSize: SIZE_600)
      knownGlitches
      zone {
        id
        depth
        label
      }
      }
}`;

export const FRAGMENT_PET_APPEARANCE = `
fragment PetAppearanceForOutfitPreview on PetAppearance {
    id
    pose
    bodyId
    isGlitched
    color {
      id
      name
    }
    species {
      id
      name
    }
    restrictedZones {
      id
      depth
      label
    }
    layers {
      id
      remoteId
      imageUrlV2(idealSize: SIZE_600)
      knownGlitches
      zone {
        id
        depth
        label
      }
    }
  }`;

export const SEARCH_ITEM_IDS =
  `
query($itemIds: [ID!]!) {
  items(ids: $itemIds) {
    ...ItemProperties
  }
}` + FRAGMENT_ITEM_PROPERTIES;

export const GRAB_PET_APPEARANCE_WITH_ITEMS_BY_IDS =
  `
query ($allItemIds: [ID!]!, $speciesId: ID!, $colorId: ID!, $size: LayerImageSize!, $pose: Pose!) {
  petAppearance(speciesId: $speciesId, colorId: $colorId, pose: $pose) {
    ...PetAppearanceForOutfitPreview
  }
  items(ids: $allItemIds) {
    ...ItemProperties
    appearanceOn(speciesId: $speciesId, colorId: $colorId) {
      ...ItemAppearanceForOutfitPreview
    }
  }
}` +
  FRAGMENT_ITEM_APPEARANCE +
  FRAGMENT_ITEM_PROPERTIES +
  FRAGMENT_PET_APPEARANCE;

export const GET_ALL_PET_COLORS = `
query{
	allColors{
	  name,
	  id,
	  isStandard
	  appliedToAllCompatibleSpecies{
		species{
		  name,
		  id
		}
	  }
	}
}
`;

export const GET_ALL_ZONES = `
query{
	allZones{
	  id,
	  label,
	  isCommonlyUsedByItems
	}
}`;

export const GET_ITEMS_COUNT = `
query($allZonesIds: [ID!]!, $speciesId: ID!, $colorId: ID!){
	itemSearchV2(query:"", zoneIds: $allZonesIds, fitsPet:{speciesId: $speciesId, colorId: $colorId}){
	  numTotalItems
	}
  }
`;

export const GET_3_ITEMS_COUNT = `query($speciesId: ID!, $colorId: ID!, $zone1: ID!, $zone2: ID!, $zone3: ID!){
    zone1: itemSearchV2(query:"", zoneIds: [$zone1], fitsPet:{speciesId: $speciesId, colorId: $colorId}){
      numTotalItems
    }
  	zone2: itemSearchV2(query:"", zoneIds: [$zone2], fitsPet:{speciesId: $speciesId, colorId: $colorId}){
      numTotalItems
    }
  	zone3: itemSearchV2(query:"", zoneIds: [$zone3], fitsPet:{speciesId: $speciesId, colorId: $colorId}){
      numTotalItems
    }
}`;

export const GET_RANDOM_ITEM =
  `
query($allZonesIds: [ID!]!, $speciesId: ID!, $colorId: ID!, $offset: Int!, $size: LayerImageSize!){
	itemSearchV2(query:"", zoneIds: $allZonesIds, fitsPet:{speciesId: $speciesId, colorId: $colorId}){
	  numTotalItems,
	  items(offset: $offset, limit: 1){
		id,
		name,
		appearanceOn(speciesId: $speciesId, colorId: $colorId){
		  ...ItemAppearanceForOutfitPreview
		}
	  },
	}
  }
` + FRAGMENT_ITEM_APPEARANCE;

export const GET_PET_APPEARANCE =
  `
query($speciesId: ID!, $colorId: ID!, $pose: Pose!, $size: LayerImageSize){
	petAppearance(speciesId: $speciesId, colorId: $colorId, pose: $pose){
	  ...PetAppearanceForOutfitPreview
	}
  }
` + FRAGMENT_PET_APPEARANCE;

export const GET_ITEM_PREVIEW_BY_NAME =
  `
query($itemName: String!, $species: ID, $color: ID) {
  itemByName(name: $itemName) {
    id
    name
    canonicalAppearance(preferredSpeciesId: $species) {
      ...ItemAppearanceForOutfitPreview
      body {
        canonicalAppearance(preferredColorId: $color) {
          ...PetAppearanceForOutfitPreview
        }
      }
    }
  }
}` +
  FRAGMENT_PET_APPEARANCE +
  FRAGMENT_ITEM_APPEARANCE;

